    #[test]
    fn time_comaprison_bit_reversal(){

        for i in 1..26 {
            let mut sum =Duration::new(0,0);
            let mut sum1=Duration::new(0,0);
            for _j in 0..10{
                let mut a:Vec<Fp>=Vec::new();
                for _k in 0..2u32.pow(i) {
                    let r=Fp::random();
                a.push(r);
                }
            let start = Instant::now();
            par_permute(&mut a);
            let duration = start.elapsed();
            sum+=duration;
            let start1 = Instant::now();
            permute(&mut a);
            let duration1 = start1.elapsed();
            sum1+=duration1;

            }
        println!("The average time duration(bit reversal) for input length 2^{} in parallel  is {:?} and in serial it is {:?} ",i,sum/10,sum1/10);
    }
    }
    #[test]
    fn get_twiddles_test(){
        
        for i in [2,4,8,16]{
            let a=Fp::get_root_of_unity(i);
            let expected:Vec<Fp>=(0..(2u32.pow(i-1))).into_par_iter().map(|x|a.power_by(Fp::from(x).0.to_words())).collect();
            assert_eq!(get_twiddles(2u32.pow(i)) as Vec<Fp>,expected);
        }
    }
    #[test]
    fn get_2_addic_test(){
        for i in 1..50{  //checks for upto 2^31 th root
            let a1=Fp::get_root_of_unity(i);
            println!("2^{i} th root of unity is {:?}",a1);
            if (a1.power_by([1<<(i-1)]))==Fp::ONE{
                panic!("correct the function definition");
            }
            else{
                assert_eq!(Fp::ONE,a1.power_by([1<<i]))
            }
        }
    }
    #[test]
    fn eval_many_test(){
        let a=vec![Fp::from(1u8),Fp::from(2u8),Fp::from(3u8),Fp::from(4u8)]; // i.e p(x) = 1 + 2x + 3x^2 + 4x^3
        let b=vec![Fp::from(0u8),Fp::from(1u8),Fp::from(2u8)];
        // p(0) = 1 ; p(1) = 10 ; p(2)= 49
        println!("{:?}",eval_many(&a, &b));
        assert_eq!(eval_many(&a, &b),[Fp::from(1u8),Fp::from(10u8),Fp::from(49u8)]);
    }
    #[test]
    fn serial_fft_test(){
        for i in 1..10 {
            // input length is stored in n which is 2^i (for i=1,2,3,...,15)
            let n=2u32.pow(i);
            // 2^i th root of unity
            let omega1=Fp::get_root_of_unity(i);
            // vector of random field elements of length n 
            let mut a:Vec<Fp>=(0..n).into_par_iter().map(|_x|Fp::random()).collect();
            // vector of omega1^powers i.e w^0,w^1,...,w^(n-1)
            let power:Vec<Fp>=(0..n).into_par_iter().map(|x|omega1.power_by(Fp::from(x as u32).0.to_words())).collect();
            // evaluation polyniomal with coeffiecints in a at different powers of w using eval_many function 
            let result=eval_many(&a,&power);
            // this will give twiddles list i.e w^0,w^1,...,w^(n-1)
            let r = serial_fft::get_twiddles(n);
            let mut _values=a.clone();
            //parallel_fft(&mut values, &get_twiddles(n));
            // permute(&mut r);
            evaluate_poly(&mut a, &r);
            assert_eq!(a,result);
        // assert_eq!(values,result," Failed at {i}");
        }
            
    }
    #[test]
    fn parallel_fft_test(){
        for i in 1..10 {
            // input length is stored in n which is 2^i (for i=1,2,3,...,15)
            let n=2u32.pow(i);
            // 2^i th root of unity
            let omega1=Fp::get_root_of_unity(i);
            // vector of random field elements of length n 
            let a:Vec<Fp>=(0..n).into_par_iter().map(|_x|Fp::random()).collect();
            // vector of omega1^powers i.e w^0,w^1,...,w^(n-1)
            let power:Vec<Fp>=(0..n).into_par_iter().map(|x|omega1.power_by(Fp::from(x as u32).0.to_words())).collect();
            // evaluation polyniomal with coeffiecints in a at different powers of w using eval_many function 
            let result=eval_many(&a,&power);
            // this will give twiddles list i.e w^0,w^1,...,w^(n-1)
            let r = get_twiddles(n);
            let mut values=a.clone();
            par_eval_poly(&mut values, &r);
            assert_eq!(values,result," Failed at {i}");
        }
    }
    #[test]
    fn benchmark(){
        for i in 2..26{
            let mut sum=Duration::new(0,0);
            let mut sum1=Duration::new(0,0);
            let mut sum2=Duration::new(0,0);
            for _ in 0..5{
                let mut a:Vec<Fp>= (0..1<<i).into_iter().map(|_x| Fp::random()).collect();
                //let mut twiddles = get_twiddles(1<<i);
                let omega: Vec<Fp> = get_twiddles(1<<i);
                let omega_1 = serial_fft::get_twiddles(1<<i);
                //permute(&mut twiddles);

                let mut values = a.clone();
                let mut _values1 = values.clone();

                let start1=Instant::now();
                evaluate_poly(&mut values, &omega_1);
                let duration1=start1.elapsed();
                sum1+=duration1;
                //let mut values1 = a.clone();
        
                
                let start=Instant::now();
                par_eval_poly(&mut a, &omega);
                let duration=start.elapsed();
                sum+=duration;

            assert_eq!(values,a);
            
                let mut values = a.clone();
                let start2=Instant::now();
                cache_fft(&mut values, &omega);
                let duration2=start2.elapsed();
                sum2+=duration2;     
            }
        println!("Size: 2^{i} \n parallel time: {:?} \n serial time: {:?} and in breadth-first: {:?}",sum/5,sum1/5,sum2/5);
        }
    }

